import React from 'react'
import Select from 'react-select'

const rooms = [
    "110","111","120","121"
]

const selectStyle = {    
    control: (base) => ({
        width: 300,
    }),

}

const Home = () => {
    return (
        <div>
            <h3>Room</h3>
            <Select styles={{control: selectStyle}} options={rooms}>
                <option value='100'>100</option>
                <option value='108'>108</option>
                <option value='93'>93</option>
            </Select>

        </div>
    )
}

export default Home
